lw = input()
word =[]
digit = 1
for element in range(lw.count('')+1) :
   word = lw.split()
   if len(str(word)) <= 10:
      print(f" {digit} {word[element]}")
      digit += 1
   else:
      print(f" {digit} {word[element][0:10]}")
      digit += 1

